            return;
        }

        if (MainActivity.errorFrameCount > 2 && Player.rewindDirection == 1) {
            Utils.showVeryBigError("LIVE");
            curRewind = false;
            imageView.setVisibility(View.GONE);
            stopRewind();
            MainActivity.errorFrameCount = 0;
            goToLive();
            return;
        }

        if (MainActivity.errorFrameCount > Utils.getInt("max_error_frames")) {
            PrettyToast.showError(context, "სურათების ჩანაწერი არ არსებობს");
