            imageView.setVisibility(View.GONE);
            stopRewind();
            MainActivity.errorFrameCount = 0;
            goToLive();
            return;
        }

        imageView.setVisibility(View.VISIBLE);
        int seconds = speed / 2;
        if (dir == -1) {
            seconds *= -1;
        }

        String time = Utils.getTimeByFrame(url);
        MainActivity.curTime.setText(time);


        int realWidth = MainActivity.screenWidth;
        int realHeight = MainActivity.screenHeight;

